  \"2015-03-04T19:17:00.503706\",\n\t\"name\": \"maryland-annual-vehicle-miles-of-travel-29d08\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Annual Vehicle Miles of Travel (AVMT) represents
  the estimated number of miles driven on Maryland's public highways for a given year.
  There are two components used to estimate AVMT - traffic count data and highway
  mileage.rnTraffic count data is summarized and reported as Annual Average Daily
  Traffic (AADT).rnrnAADTs are calculated from short-term (48-hour) traffic counts
  performed on all publicly maintained roads in Maryland (including county and municipal).
  \ These counts are factored to account for seasonal variation in traffic patterns
  and represent an u201cAverage Dayu201d. rnrnFor planning purposes, AADT's are assigned
  to highway segments in order to provide a picture of traffic patterns is on the
  highway system on an average day.rnHighway mileage statistics are complied annually
  based on mileage reports from the local jurisdictions and SHA and MDTA offices.
  \ Any mileage changes  are field verified by SHA's data collections crews.   rnrnAVMT
  is calculated by multiplying the AADT on a road segment by the segment length. Because
  AADT represents Daily traffic, the result is multiplied by 365 to represent Annual
  Vehicle Miles of Travel. (AVMT = AADT X SECTION LENGTH X365)\",\n\t\"license_title\":
